import React from 'react';

export default function Plmin() {
    return (
        <div class="plmin">
            <img src="img/minus.svg" alt="" class="plmin__minus" />
            <div class="plmin__number">1</div>
            <img src="img/plus.svg" alt="" class="plmin__plus" />
        </div>
    )
};
